import './App.css';
import Navbars from './Componets/Navbars';
import NewsShow from './Componets/NewsShow';
import {
  BrowserRouter as Router,
  Switch,
  Route,

} from "react-router-dom";
export class App extends Component {
  render() {
    return (
      <div>
      <Navbars/>
      <NewsShow pageSize={6} country='in' category='general'/>
      <NewsShow pageSize={6} country='in' category='science'/>
      <li>
          <Route path="/home"> <NewsShow pageSize={6} country='in' category='general'/> </Route>
      </li>

      </div>
    )
    }
}

export default App
